import styled from 'styled-components';
import tw from 'twin.macro';
import './App.css';
import { HomePage } from './app/containers/HomePage';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


const AppContainer = styled.div`
  ${tw`
    w-full
    h-full
    flex
    flex-col
  `}
`

function App() {
  return (
    <AppContainer>
      <Router>
        <HomePage />
      </Router>
    </AppContainer>
  );
}

export default App;
